$(document).on("click","#TriggerLogout",function(){$("#logoutForm").submit()});$(document).on("click",".GroupToggler",function(){$(this).parent().parent().parent().find(".GroupToggleThis").each(function(){$(this).toggle()});$(this).hasClass("fa-arrow-down")?$(this).attr("class","fa fa-arrow-up GroupToggler"):$(this).attr("class","fa fa-arrow-down GroupToggler")});